metadata:
  id: "debounce"
  inputs:
    - name: "value"
      type: "any"
      reactive: true
    - name: "delay"
      type: "number"
  outputs:
    - name: "debouncedValue"
      type: "any"
  completion: "explicit"

function debounce(value: any, delay: number): Promise<any> {
  return new Promise((resolve) => {
    setTimeout(() => {
      resolve(value);
    }, delay);
  });
}
